import { getDbpPath as _getDbpPath } from '@portal/api/dashboard/dashboard';
import { MessageBox } from "element-ui";
export default {
  name: "ThirdpartyDashBoard",
  data: function data() {
    return {
      dbpPath: '',
      frameWidth: '100%',
      frameHeight: 'auto'
    };
  },
  mounted: function mounted() {
    var _self = this;

    this.getDbpPath(); //this.frameHeight = window.innerHeight - 202

    this.frameHeight = window.innerHeight;
  },
  methods: {
    getDbpPath: function getDbpPath() {
      var _this = this;

      _getDbpPath().then(function (res) {
        console.log("getDbpPatheee==>" + res.toString());

        if (res.code == 0) {
          _this.dbpPath = res.data;
        } else {
          _this.$message({
            showClose: true,
            message: res.msg,
            type: 'error'
          });
        }
      });
    }
  }
};
